import s from "./hero.module.scss";
import heroimg from "../../assets/images/svg/illustration-hero.svg";
export const Hero = () => {
  return (
    <div>
      <div>Dlaczego my?</div>
      <div>
        Wykonujemy usługi alpinistyczne oraz na wysokościach (tzw. prace
        alpinistyczne). Pracujemy głównie na terenie Warszawy i okolic, ale
        możemy dojechać do każdego miejsca w Polsce. Wyróżnia nas dbałość o
        detale, wykonywanie zadań na czas oraz brak ukrytych kosztów. Wszelkiego
        rodzaju usługi alpinistyczne to dziedzina w ktoej staliśmy się
        ekspertami.
      </div>
    </div>
  );
};
